import React from 'react';
import './App.css';
import {
Container,
Col,
Row,
Image
} from "bootstrap"; 

function App() {
  return (
    <Container>
  <Row>

    <Col xs={6} md={4}>
      <Image src="holder.js/171x180" roundedCircle />
    </Col>

  </Row>
</Container>
  );
}

export default App;
